DROP TABLE IF EXISTS `session`;
CREATE TABLE `session` (
  `session_key` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `member_srl` bigint NOT NULL,
  `expired` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `val` longtext COLLATE utf8mb4_unicode_ci,
  `ipaddress` varchar(60) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `last_update` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `cur_mid` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`session_key`),
  KEY `idx_session_member_srl` (`member_srl`),
  KEY `idx_session_expired` (`expired`),
  KEY `idx_session_update` (`last_update`),
  KEY `idx_session_cur_mid` (`cur_mid`),
  KEY `idx_session_update_mid` (`member_srl`,`last_update`,`cur_mid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop`;
CREATE TABLE `shop` (
  `shop_no` bigint NOT NULL AUTO_INCREMENT,
  `shop_cd` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `business_number` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `phone` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `postcode` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `road_address` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `jibun_address` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `extra_address` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `detail_address` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `map_x` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `map_y` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `pos_type` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `qr_size` bigint DEFAULT NULL,
  `pos_number` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `order_auto` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Y',
  `order_auto_popup` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N',
  `order_sound` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Y',
  `order_print` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N',
  `otp_print` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Y',
  `printer_port` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `printer_speed` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `login_pass` varchar(250) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`shop_no`),
  KEY `idx_shop_cd` (`shop_cd`),
  KEY `idx_name` (`name`),
  KEY `idx_business_number` (`business_number`),
  KEY `idx_phone` (`phone`),
  KEY `idx_postcode` (`postcode`),
  KEY `idx_road_address` (`road_address`),
  KEY `idx_jibun_address` (`jibun_address`),
  KEY `idx_extra_address` (`extra_address`),
  KEY `idx_detail_address` (`detail_address`),
  KEY `idx_map_x` (`map_x`),
  KEY `idx_map_y` (`map_y`),
  KEY `idx_regdate` (`regdate`),
  KEY `idx_pos_type` (`pos_type`),
  KEY `idx_order_auto` (`order_auto`),
  KEY `idx_order_auto_popup` (`order_auto_popup`),
  KEY `idx_order_sound` (`order_sound`),
  KEY `idx_order_print` (`order_print`),
  KEY `idx_otp_print` (`otp_print`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_board`;
CREATE TABLE `shop_board` (
  `shop_no` bigint NOT NULL,
  `module_srl` bigint NOT NULL,
  KEY `idx_shop_no` (`shop_no`),
  KEY `idx_module_srl` (`module_srl`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_category`;
CREATE TABLE `shop_category` (
  `category_no` bigint NOT NULL AUTO_INCREMENT,
  `shop_no` bigint NOT NULL,
  `tu_cls_cd` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `name` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `step` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `sequence` bigint NOT NULL DEFAULT '0',
  `use` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL DEFAULT 'N',
  `type` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `pos_category` text COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`category_no`),
  KEY `idx_shop_no` (`shop_no`),
  KEY `idx_tu_cls_cd` (`tu_cls_cd`),
  KEY `idx_name` (`name`),
  KEY `idx_step` (`step`),
  KEY `idx_sequence` (`sequence`),
  KEY `idx_use` (`use`),
  KEY `idx_type` (`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_conn_menu_category`;
CREATE TABLE `shop_conn_menu_category` (
  `category_no` bigint NOT NULL,
  `menu_no` bigint NOT NULL,
  `sequence` bigint NOT NULL,
  KEY `category_no` (`category_no`),
  KEY `idx_menu_no` (`menu_no`),
  KEY `idx_sequence` (`sequence`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_conn_order_menu`;
CREATE TABLE `shop_conn_order_menu` (
  `order_no` bigint NOT NULL,
  `menu_no` bigint NOT NULL,
  `amount` bigint NOT NULL,
  KEY `order_no` (`order_no`),
  KEY `idx_menu_no` (`menu_no`),
  KEY `idx_amount` (`amount`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_manager`;
CREATE TABLE `shop_manager` (
  `shop_no` bigint NOT NULL,
  `member_srl` bigint NOT NULL,
  KEY `idx_shop_no` (`shop_no`),
  KEY `idx_member_srl` (`member_srl`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_menu`;
CREATE TABLE `shop_menu` (
  `menu_no` bigint NOT NULL AUTO_INCREMENT,
  `shop_no` bigint NOT NULL,
  `prod_cd` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(250) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `price` bigint NOT NULL,
  `discount` bigint DEFAULT NULL,
  `sequence` bigint NOT NULL,
  `visible` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL DEFAULT 'Y',
  `pos_menu` text COLLATE utf8mb4_unicode_ci,
  `image` varchar(250) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`menu_no`),
  KEY `idx_shop_no` (`shop_no`),
  KEY `idx_prod_cd` (`prod_cd`),
  KEY `idx_name` (`name`),
  KEY `idx_price` (`price`),
  KEY `idx_sequence` (`sequence`),
  KEY `idx_visible` (`visible`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_order`;
CREATE TABLE `shop_order` (
  `order_no` bigint NOT NULL AUTO_INCREMENT,
  `shop_no` bigint NOT NULL,
  `table_cd` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `otp_pin` char(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '4자리숫자',
  `regdate` varchar(14) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `status` int NOT NULL DEFAULT '0' COMMENT '0:주문 요청, 1:주문 성공',
  `pos_order` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `connect_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`order_no`),
  KEY `idx_connect_code` (`connect_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `shop_table`;
CREATE TABLE `shop_table` (
  `table_no` bigint NOT NULL AUTO_INCREMENT,
  `shop_no` bigint NOT NULL,
  `table_cd` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `use` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `pos_table` text COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`table_no`),
  KEY `idx_shop_no` (`shop_no`),
  KEY `idx_table_cd` (`table_cd`),
  KEY `idx_name` (`name`),
  KEY `idx_use` (`use`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `site_admin`;
CREATE TABLE `site_admin` (
  `site_srl` bigint NOT NULL,
  `member_srl` bigint NOT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  UNIQUE KEY `idx_site_admin` (`site_srl`,`member_srl`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `sites`;
CREATE TABLE `sites` (
  `site_srl` bigint NOT NULL,
  `index_module_srl` bigint DEFAULT '0',
  `domain` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `default_language` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`site_srl`),
  UNIQUE KEY `unique_domain` (`domain`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `spamfilter_denied_ip`;
CREATE TABLE `spamfilter_denied_ip` (
  `ipaddress` varchar(60) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `hit` bigint NOT NULL DEFAULT '0',
  `latest_hit` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `except_member` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT 'N',
  `description` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`ipaddress`),
  KEY `idx_hit` (`hit`),
  KEY `idx_latest_hit` (`latest_hit`),
  KEY `idx_regdate` (`regdate`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `spamfilter_denied_word`;
CREATE TABLE `spamfilter_denied_word` (
  `word` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `hit` bigint NOT NULL DEFAULT '0',
  `latest_hit` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `except_member` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT 'N',
  `filter_html` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT 'N',
  `is_regexp` char(1) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT 'N',
  `description` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`word`),
  KEY `idx_hit` (`hit`),
  KEY `idx_latest_hit` (`latest_hit`),
  KEY `idx_regdate` (`regdate`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `spamfilter_log`;
CREATE TABLE `spamfilter_log` (
  `spamfilter_log_srl` bigint NOT NULL,
  `ipaddress` varchar(60) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`spamfilter_log_srl`),
  KEY `idx_ipaddress` (`ipaddress`),
  KEY `idx_regdate` (`regdate`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `tags`;
CREATE TABLE `tags` (
  `tag_srl` bigint NOT NULL,
  `module_srl` bigint NOT NULL DEFAULT '0',
  `document_srl` bigint NOT NULL DEFAULT '0',
  `tag` varchar(180) COLLATE utf8mb4_unicode_ci NOT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`tag_srl`),
  KEY `idx_module_srl` (`module_srl`),
  KEY `idx_document_srl` (`document_srl`),
  KEY `idx_regdate` (`regdate`),
  KEY `idx_tag` (`document_srl`,`tag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `trash`;
CREATE TABLE `trash` (
  `trash_srl` bigint NOT NULL,
  `title` varchar(250) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `origin_module` varchar(250) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'document',
  `serialized_object` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `ipaddress` varchar(60) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `remover_srl` bigint NOT NULL,
  `regdate` char(14) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`trash_srl`),
  KEY `idx_regdate` (`regdate`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


